import React, { useState } from "react";
import { GeneratedMeme } from "./components/GeneratedMeme";
export const HistoryMemes = () => {
  const [memes, setMemes] = useState([]);

  for (let i = 0; i < localStorage.length; i++) {
    let key = localStorage.key(i);
    console.log("local storage: ", localStorage.getItem(key));
    memes.push(localStorage.getItem(key));
    setMemes(memes);
    console.log("my memes: ", memes);
    {
      memes.map((template) => {
        return (
          <GeneratedMeme
            template={template}
            onClick={() => {
              setTemplate(template);
            }}
          />
        );
      });
    }
  }
};

export default HistoryMemes;
